
CREATE TABLE `vendor`.`vendor_booking` (
`id` int NOT NULL AUTO_INCREMENT,
`customer_order_number` varchar(255) DEFAULT NULL,
`sequence_timestamp` varchar(255) DEFAULT NULL,
`planned_shipping_date_and_time` datetime DEFAULT NULL,
`shipment_creation_date_time` datetime DEFAULT NULL,
`order_status` varchar(255) DEFAULT NULL,
`shipment_inco_terms` varchar(255) DEFAULT NULL,
`commodity_code` varchar(255) DEFAULT NULL,
`commodity_text` varchar(1000) DEFAULT NULL,
`shipment_service_code` varchar(100) DEFAULT NULL,
`dangerous_goods` varchar(45) DEFAULT NULL,
`content_id` varchar(255) DEFAULT NULL,
`uncode` varchar(255) DEFAULT NULL,
`consignor_ref` varchar(255) DEFAULT NULL,
`hwab` varchar(255) DEFAULT NULL,
`response_error_code` varchar(1000) DEFAULT NULL,
`response_error_title` varchar(255) DEFAULT NULL,
`response_error_detail` varchar(255) DEFAULT NULL,
`response_time_stamp` datetime DEFAULT NULL,
`createdAt` datetime DEFAULT NULL,
`updatedAt` datetime DEFAULT NULL,
`deletedAt` datetime DEFAULT NULL,
PRIMARY KEY (`id`)
);





CREATE TABLE `vendor`.`documents` (
